import './App.css';
import Header from './Header';

function App() {  
  const handleNameChange = () => {
    const names = ['Bob', 'Kevin', 'Mike', 'John', 'Dave'];
    const rnd = Math.floor(Math.random() * 3);
    return names[rnd];
  }
  return (
    <div className="App">
      <Header />
    </div>
  );
}

export default App;
